import './Navbar.css'
import { NavLink } from 'react-router-dom'
import React, {useState} from "react";

const Navbar = () => {

    const [loginStatus, setLoginStatus] = useState("");

    function getCookie(name) {
        var dc = document.cookie;
        var prefix = name + "=";
        var begin = dc.indexOf("; " + prefix);
        if (begin === -1) {
            begin = dc.indexOf(prefix);
            if (begin !== 0) return null;
        }
        else
        {
            begin += 2;
            var end = document.cookie.indexOf(";", begin);
            if (end === -1) {
            end = dc.length;
            }
        }
        // because unescape has been deprecated, replaced with decodeURI
        //return unescape(dc.substring(begin + prefix.length, end));
        return decodeURI(dc.substring(begin + prefix.length, end));
    } 
    
    function doSomething() {
        var myCookie = getCookie("userId");
    
        if (myCookie === null) {
            setLoginStatus("Zaloguj się");
        }
        else {
            setLoginStatus("Wyloguj się");
        }
    }
    doSomething()
    return (
            <div
                className='collapse navbar-collapse'
                id='navbarSupportedContent'
            >
                
                <ul className="navbar-nav ml-auto">
                    <li className='nav-item active'>
                        <NavLink className="nav-link" to="/" exact>
                            <i
                            className='fas fa-home'>
                            </i> Strona główna
                        </NavLink>
                    </li>

                    <li className='nav-item'>
                        <NavLink className="nav-link" to="/category" exact>
                            <i
                            className='fab fa-buromobelexperte'>
                            </i> Kategorie
                        </NavLink>
                    </li>

                    
                    <li className='nav-item'>
                        <NavLink className="nav-link" to="/ofert" exact>
                            <i
                            className='fas fa-book-open'>
                            </i> Oferty
                        </NavLink>
                    </li>

                    <li className='nav-item'>
                        <NavLink className="nav-link" to="/register" exact>
                            <i
                            className='fas fa-sign-in-alt'>
                            </i> Zarejestruj
                        </NavLink>
                    </li>

                    <li className='nav-item'>
                        <NavLink className="nav-link" to="/login" exact>
                            <i
                            className='fas fa-key'>
                            </i> {loginStatus}
                        </NavLink>
                    </li>

                </ul>
            </div>
    )
}

export default Navbar
